import React, { useState, useRef, useEffect } from 'react';

import meter1 from "../assets/img/Nathan-Team22.png";
import meter2 from "../assets/img/Philippe-Team.png";
import meter3 from "../assets/img/Killian-Team.png";
import meter4 from "../assets/img/Maxime-Team.png";
import meter5 from "../assets/img/Isaak-Team.png";
import meter6 from "../assets/img/Clement-Team.png";
import meter7 from "../assets/img/Quentin-Team.png";
import Carousel from 'react-multi-carousel';
import 'react-multi-carousel/lib/styles.css';
import arrow1 from "../assets/img/arrow1.svg";
import arrow2 from "../assets/img/arrow2.svg";
import colorSharp from "../assets/img/color-sharp.png";
import colorSharpR from "../assets/img/color-sharp-right.png";

const MyCarousel = () => {
  const carouselRef = useRef(null);

  const [slideIndex, setSlideIndex] = useState(0);

  const handleNextClick = () => {
    console.log("slide Index --> %d", slideIndex)
    setSlideIndex(slideIndex + 1);
  };

  const handlePrevClick = () => {
    console.log("slide Index --> %d", slideIndex)
    setSlideIndex(slideIndex - 1);
  };

  useEffect(() => {
    if (carouselRef.current) {
      const carousel = carouselRef.current;

      // Get default navigation buttons
      const prevButton = document.querySelector('.react-multi-carousel__arrow--left');
      const nextButton = document.querySelector('.react-multi-carousel__arrow--right');

      // Attach event listeners to the navigation buttons
      if (prevButton && nextButton) {
        prevButton.addEventListener('click', () => {
          carousel.previous();
        });

        nextButton.addEventListener('click', () => {
          handleNextClick()
          carousel.next();
        });
      }
    }
  }, [carouselRef.current]); // Add carouselRef.current as a dependency

  // Define responsive configuration for the carousel
  const responsive = {
    superLargeDesktop: {
      // the naming can be any, depends on you.
      breakpoint: { max: 4000, min: 3000 },
      items: 5
    },
    desktop: {
      breakpoint: { max: 3000, min: 1024 },
      items: 3
    },
    tablet: {
      breakpoint: { max: 1024, min: 464 },
      items: 2
    },
    mobile: {
      breakpoint: { max: 464, min: 0 },
      items: 1
    }
  };

  return (
    <Carousel
      ref={carouselRef}
      infinite={true}
      className="owl-carousel owl-theme skill-slider"
      responsive={responsive}
    >
      {/* Carousel items */}
      <div className="item">
        <img src={meter1} alt="Image" />
        <h5>Web Development</h5>
      </div>
      <div className="item">
        <img src={meter2} alt="Image" />
        <h5>Brand Identity</h5>
      </div>
      <div className="item">
        <img src={meter3} alt="Image" />
        <h5>Logo Design</h5>
      </div>
      <div className="item">
        <img src={meter4} alt="Image" />
        <h5>Web Development</h5>
      </div>
      <div className="item">
        <img src={meter5} alt="Image" />
        <h5>Web Development</h5>
      </div>
      <div className="item">
        <img src={meter6} alt="Image" />
        <h5>Web Development</h5>
      </div>
      <div className="item">
        <img src={meter7} alt="Image" />
        <h5>Web Development</h5>
      </div>
    </Carousel>
  );

};


export const Skills = () => {
  const [slideIndex, setSlideIndex] = useState(0);

  const responsive = {
    superLargeDesktop: {
      // the naming can be any, depends on you.
      breakpoint: { max: 4000, min: 3000 },
      items: 5
    },
    desktop: {
      breakpoint: { max: 3000, min: 1024 },
      items: 3
    },
    tablet: {
      breakpoint: { max: 1024, min: 464 },
      items: 2
    },
    mobile: {
      breakpoint: { max: 464, min: 0 },
      items: 1
    }
  };

  const carouselRef = useRef();

  // Function to handle going to the previous slide
  const goToPrevSlide = () => {
    carouselRef.current.previous();
    console.log("slide Index --> %d", slideIndex)
    setSlideIndex(slideIndex + 1);
  };

  // Function to handle going to the next slide
  const goToNextSlide = () => {
    carouselRef.current.next();
    console.log("slide Index --> %d", slideIndex)
    setSlideIndex(slideIndex - 1);
  };

  const handleNextClick = () => {
    console.log("slide Index --> %d", slideIndex)
    setSlideIndex(slideIndex + 1);
  };

  const handlePrevClick = () => {
    console.log("slide Index --> %d", slideIndex)
    setSlideIndex(slideIndex - 1);
  };

  const handleButtonClick = (label) => {
    if (label === "Go to previous slide") {
      handlePrevClick();
    } else {
      handleNextClick();
    }
  };

  return (
    <section className="skill" id="team">
      <div className="container">
        <div className="row">
          <div className="col-12">
            <div className="skill-bx wow zoomIn">
              <h2>Equipe</h2>
              <p>Lorem Ipsum is simply dummy text of the printing and typesetting industry.<br></br> Lorem Ipsum has been the industry's standard dummy text.</p>
              <MyCarousel/>
            </div>
          </div>
        </div>
      </div>
    </section>
  );
};
